import React from "react";
import { Text, View, StyleSheet, Dimensions, Image } from "react-native";

const kart = () => {
    return (
        <View style={styles.kartContainer}>
            <Image style={styles.imageStyle} source={require('../../assets/image5.jpg')} />
        </View>
    );
};


const genislik = Dimensions.get("window").width;

const radius = 20;

const styles = StyleSheet.create({
    kartContainer: {
        width: genislik - 20,
        backgroundColor: '#a29bfe',
        height: 200,
        borderRadius: 20,

        shadowColor: '#000',
        shadowOffset: {
            width: 5,
            height: 5,
        },
        shadowOpacity: 0.75,
        shadowRadius: 5,
        elevation: 9,
    },
    imageStyle: {
        height: 130,
        width: genislik - 20,
        borderTopLeftRadius: 5,

    },

});
export default kart;
